DROP TABLE IF EXISTS "dublin_fire_station" CASCADE;

CREATE TABLE "dublin_fire_station" (
  "pkid"  SERIAL not null PRIMARY KEY,
  "wkb_geometry" geometry,
  "id" VARCHAR(254),
  "addr_city" VARCHAR(254),
  "amenity" VARCHAR(254),
  "building" VARCHAR(254)
);
CREATE INDEX "dublin_fire_station_wkb_geometry_geom_idx" ON "dublin_fire_station" USING GIST ("wkb_geometry");


